description:
This book aims to give the reader an insight into the training plans and fitness methods of the top Olympic stars. It might not get you onto the podium at the Olympic stadium, but it will help you to achieve you own personal fitness goals.

Men's Fitness UK Train like an Olympian - MagBook 2013
Book Language: English 
Pages: 164
